import React from "react";
import './App.css';
function Navbar() {
  const myStyle = {
    backgroundColor: 'lightyellow',
    padding: '10px',
    borderRadius: '5px',
    // width:"90px",
    height:"8vh"

  };
  return (
    <>
    <nav>
    <div id="logo">
      <img src="./images/logo.png" alt="logo.png" style={myStyle} />
    </div>
    <ul>
      <li>Home</li>
      <li>About</li>
      <li>Services</li>
      <li>Contact</li>
      <li>News</li>
      <li>Pages</li>
      <li>Packages</li>
      <li>Shop</li>
    </ul>

    <button className="btn" type="submit">Login</button>

    </nav>
    </>
  );
}

export default Navbar;
